import React from "react";
import styled from "styled-components";

export default function Butonlar(props) {
  const { page, setPage, handlePage } = props;
  const StyledButton = styled.button`
    background-color: blue;
  `;
  return (
    <div>
      <StyledButton onClick={() => handlePage("1")}>Page 1</StyledButton>
      <StyledButton onClick={() => handlePage("2")}>Page 2</StyledButton>
      <StyledButton onClick={() => handlePage("3")}>Page 3</StyledButton>
      <StyledButton onClick={() => handlePage("4")}>Page 4</StyledButton>
      <StyledButton onClick={() => handlePage("5")}>Page 5</StyledButton>
      <StyledButton onClick={() => handlePage("6")}>Page 6</StyledButton>
      <StyledButton onClick={() => handlePage("7")}>Page 7</StyledButton>
      <StyledButton onClick={() => handlePage("8")}>Page 8</StyledButton>
      <StyledButton onClick={() => handlePage("9")}>Page 9</StyledButton>
    </div>
  );
}
